                    if (result) {
                        resetBtn.removeClass('hidden');
                        delBtn.removeClass('hide');
                        div.css('background-image', 'url(""' + result + '"")').find('input:hidden').val(result).change();
                    }
                },
                error: function () {
                    $.dialog.alertTips('图片上传出错,请重新上传！');
                }
            }).upload();
        });
        $('.product.pic .upload_pic input:");
